import { Component, Input } from '@angular/core';

interface Plan {
  [key: string]: string | number | boolean;
}

@Component({
  selector: 'app-register-page3',
  templateUrl: './register-page3.component.html',
  styleUrls: ['./register-page3.component.css'],
  inputs: ['nextFn', 'prevFn']
})
export class RegisterPage3Component {
  @Input() nextFn!: Function;
  @Input() prevFn!: Function;
  planSelection: number = 0;

  planFeatures = [
    ["price", "Monthly price"],
    ["quality","Video quality"]
  ]
  plans: Plan[] = [
    {
      name: "Basic with ads",
      price: 6.99,
      quality: "Good",
      resolution: "720p",
      watch: true,
      downloads: false
    },
    {
      name: "Standard",
      price: 9.99,
      quality: "Good",
      resolution: "720p",
      watch: true,
      downloads: false
    },
    {
      name: "Premium",
      price: 14.99,
      quality: "Good",
      resolution: "720p",
      watch: true,
      downloads: false
    }
  ];

  select(newSelection : number) {
    this.planSelection = newSelection;
  }
}
